import * as React from 'react';
import TextField from '@mui/material/TextField';
import { outlinedInputClasses } from '@mui/material/OutlinedInput';
import Box from '@mui/material/Box';
import { createTheme, ThemeProvider, useTheme } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Form } from 'react-router-dom';


const customTheme = (outerTheme) =>
  createTheme({
    palette: {
      mode: outerTheme.palette.mode,
    },
    components: {
      MuiTextField: {
        styleOverrides: {
          root: {
            '--TextField-brandBorderColor': '#E0E3E7',
            '--TextField-brandBorderHoverColor': '#B2BAC2',
            '--TextField-brandBorderFocusedColor': '#6F7E8C',
            '& label.Mui-focused': {
              color: 'var(--TextField-brandBorderFocusedColor)',
            },
          },
        },
      },
      MuiOutlinedInput: {
        styleOverrides: {
          notchedOutline: {
            borderColor: 'var(--TextField-brandBorderColor)',
          },
          root: {
            [`&:hover .${outlinedInputClasses.notchedOutline}`]: {
              borderColor: 'var(--TextField-brandBorderHoverColor)',
            },
            [`&.Mui-focused .${outlinedInputClasses.notchedOutline}`]: {
              borderColor: 'var(--TextField-brandBorderFocusedColor)',
            },
          },
        },
      },
      MuiFilledInput: {
        styleOverrides: {
          root: {
            '&::before, &::after': {
              borderBottom: '2px solid var(--TextField-brandBorderColor)',
            },
            '&:hover:not(.Mui-disabled, .Mui-error):before': {
              borderBottom: '2px solid var(--TextField-brandBorderHoverColor)',
            },
            '&.Mui-focused:after': {
              borderBottom: '2px solid var(--TextField-brandBorderFocusedColor)',
            },
          },
        },
      },
      MuiInput: {
        styleOverrides: {
          root: {
            '&::before': {
              borderBottom: '2px solid var(--TextField-brandBorderColor)',
            },
            '&:hover:not(.Mui-disabled, .Mui-error):before': {
              borderBottom: '2px solid var(--TextField-brandBorderHoverColor)',
            },
            '&.Mui-focused:after': {
              borderBottom: '2px solid var(--TextField-brandBorderFocusedColor)',
            },
          },
        },
      },
    },
  });

export default function Formulario({mylabel1, mylabel2, mylabel3, text, myfunction, onChange1, onChange2, onChange3, list, value}) {
  const outerTheme = useTheme();


  return (

    <div>

    <Box sx={{ display:'flex', justifyContent:'center', alignItems:'center'}}>
        <h1>{text}</h1>
    </Box>

    <Box
      sx={{ display: 'flex', justifyContent:'center', alignItems:'center', gridTemplateColumns: { sm: '400px' }, gap: 2 }}   
    >

        <form onSubmit={myfunction}>
            <ThemeProvider theme={customTheme(outerTheme)}>
                <TextField label={mylabel1} onChange={onChange1} />
                <TextField label={mylabel2} onChange={onChange2}/>
                <select style={{height:'50'}} value={value} onChange={onChange3}>
                  <option value=''>Selecie um vendedor</option>
                  {list.map((item)=>
                      <option key={item.id} value={item.id}>{item.nome}</option>
                  )}
                </select>
                <Button sx= {{top:'8px', left:'8px'}} type='submit' variant="contained" color="success">Enviar</Button>
            </ThemeProvider>
        </form>

    </Box>
    </div>
  );
}
